import React, { Component } from "react";
import Card from "./Card";

class Imagelist extends Component {
  // callLikeReq = () => {
  //   this.props.onLike("lol");
  // };

  render() {
    const images = this.props.images;
    return (
      <div className="list-container">
        {images.map((image) => (
          <Card>
            <img
              src={image.src.tiny}
              alt="lol"
              onClick={() => {
                this.props.onLike("lol");
              }}
            />
          </Card>
        ))}
      </div>
    );
  }
}

export default Imagelist;
